struct VSC_main*
VSC_main_New(struct vsmw_cluster *vc,
    struct vsc_seg **sg, const char *fmt, ...)
{
	va_list ap;
	struct VSC_main *retval;

	va_start(ap, fmt);
	retval = VRT_VSC_Alloc(vc, sg, vsc_main_name, VSC_main_size,
	    vsc_main_json, sizeof vsc_main_json, fmt, ap);
	va_end(ap);
	return(retval);
}

void
VSC_main_Destroy(struct vsc_seg **sg)
{
	struct vsc_seg *p;

	AN(sg);
	p = *sg;
	*sg = NULL;
	VRT_VSC_Destroy(vsc_main_name, p);
}

